/**
 * Implement wildcard pattern matching with support for '?' and '*'.

'?' Matches any single character.
'*' Matches any sequence of characters (including the empty sequence).

The matching should cover the entire input string (not partial).

The function prototype should be:
bool isMatch(const char *s, const char *p)

Some examples:
isMatch("aa","a") ? false
isMatch("aa","aa") ? true
isMatch("aaa","aa") ? false
isMatch("aa", "*") ? true
isMatch("aa", "a*") ? true
isMatch("ab", "?*") ? true
isMatch("aab", "c*a*b") ? false
 */
#include <iostream>
#include <vector>

using namespace std;

class Solution {
public:
    bool isMatch(const char *s, const char *p) {
        // Start typing your C/C++ solution below
        // DO NOT write int main() function
        // dynamic programming
        if (!*s && !*p) return true;
        
        // length of s
        int sl = 0;
        const char *ss = s;
        while (*ss) {
            sl++;
            ss++;
        }
        int pl = 0;
        const char *pp = p;
        while(*pp){ if (*pp!='*') ++pl; ++pp; }
        if (sl < pl) return false;
        
        vector<vector<bool> > dp(2, vector<bool>(sl + 1, false));
        dp[0][0] = true;
        
        bool cur = 1;
        
        while (*p) {
            if (*p == '*') {
                //skip all following '*'
                while (*(p + 1) == '*') {
                    p++;
                }
                dp[cur][0] = dp[!cur][0];
                int i = 1;
                for (; i <= sl; i++) {
                    if (dp[cur][i - 1] || dp[!cur][i]) break;
                    else dp[cur][i] = false;
                }
                for (; i <= sl; i++) {
                    dp[cur][i] = true;
                }
            } else {
                dp[cur][0] = false;
                
                for (int i = 1; i <= sl; i++) {
                    if (*p == '?' || *p == s[i - 1]) dp[cur][i] = dp[!cur][i - 1];
                    else dp[cur][i] = false;
                }
            }
            p++;
            cur = !cur;
        }
        
        return dp[!cur][sl];
    }
};

int main () {
    Solution s;
    cout << s.isMatch("", "**") << endl;
}